			shellScript = "# We need to do this separately from compiling the Haskell code as the compilation script\n# will only be executed by Xcode if any of the input files changes. This script, however,\n# will run unconditionally and ensure that the spritekit dylib is part of the list of files\n# linked into this framework.\n\nsource HaskellSpriteKit/HaskellConfigVars.sh\n\nif [ $GHC_FRAMEWORK_EXISTS = \"YES\" ];\nthen\n  LIBPATH=`$GHC_PKG --package-db=$GHCLIB/package.conf.d field $PKG dynamic-library-dirs | cut -f 2 -d ' '`\nelse\n  LIBPATH=`$GHC_PKG field $PKG dynamic-library-dirs | cut -f 2 -d ' '`\nfi\necho \"LIBPATH = $LIBPATH\"\n\n# NB: With the new build system, the Xcode 9 approach of adding the .dylib to the 'LinkFileList' does not work anymore as the \n#     required sequencing of the build phases can not longer be guaranteed.\n#\n# The new approach is to symbolic link the statically not predictable name of the dylib (due to the hash) to a simpler name,\n# which is added to the link list by way \"Other Linker Options\" in the build settings.\n\nLINK_FILE_LIST_VAR=\"LINK_FILE_LIST_${BUILD_VARIANTS}_${ARCHS_STANDARD}\"\nHASKELL_SPRITEKIT_DYLIB=`ls $LIBPATH/libHSspritekit-${CURRENT_PROJECT_VERSION}*.dylib`\n# echo \"LinkFileList = ${!LINK_FILE_LIST_VAR}\"\n# mkdir -p `dirname ${!LINK_FILE_LIST_VAR}`\n# echo $HASKELL_SPRITEKIT_DYLIB >>${!LINK_FILE_LIST_VAR}\n# echo \"Added to LinkFileList: $HASKELL_SPRITEKIT_DYLIB\"\n\necho \"Symbolic linking $HASKELL_SPRITEKIT_DYLIB to ${DERIVED_FILE_DIR}/libHSspritekit-${CURRENT_PROJECT_VERSION}.dylib\"\nln -sfh ${HASKELL_SPRITEKIT_DYLIB} ${DERIVED_FILE_DIR}/libHSspritekit-${CURRENT_PROJECT_VERSION}.dylib\n";
